         OgretimTipi ogretimTipi;
         uint32 ogretimDili;
         uint8 ulke;
         uint32 sehir;
        }
       
         enum EgitimDurumu { 
             Lisans, 
             OnLisans, 
             YuksekLisans,
             Doktora }

         enum OgretimTipi { 
             OrgunOgretim, 
             AcikOgretim, 
             IkinciOgretim,
             UzaktanOgretim }

      /*
     
      function isUniversity(address _address) public view returns(bool){
